import React, { useState, useEffect } from "react";
import MouseDotEffect from "./MouseDotEffect";

const Header = () => {
  // State to toggle the side menu
  const [menuOpen, setMenuOpen] = useState(false);

  // Function to toggle the menu
  const toggleMenu = () => {
    setMenuOpen((prevState) => !prevState);
  };

  // Typing effect for "Frontend Developer"
  useEffect(() => {
    const element = document.querySelector(".heading-1");
    const text = "Frontend Developer";
    let index = 0;
    let isDeleting = false;

    const typeEffect = () => {
      if (!isDeleting && index <= text.length) {
        element.textContent = text.substring(0, index);
        index++;
      } else if (isDeleting && index >= 0) {
        element.textContent = text.substring(0, index);
        index--;
      }

      if (index === text.length) {
        isDeleting = true;
        setTimeout(typeEffect, 1000); // Pause after completing
        return;
      } else if (index === 0) {
        isDeleting = false;
      }

      setTimeout(typeEffect, isDeleting ? 150 : 150); // Typing and deleting speed
    };

    typeEffect();
  }, []);

  return (
    <div>
      <MouseDotEffect />
      <div className="gradient-container">
        <header id="header" className="relative">
          {/* Hamburger Menu Button */}
          <button
            id="fa-bars"
            className={`open ${menuOpen ? "hidden" : ""}`}
            onClick={toggleMenu}>
            <svg
              xmlns="http://www.w3.org/2000/svg"
              height="24px"
              viewBox="0 -960 960 960"
              width="24px"
              fill="#e8eaed">
              <path d="M120-240v-80h720v80H120Zm0-200v-80h720v80H120Zm0-200v-80h720v80H120Z" />
            </svg>
          </button>

          {/* Side Menu */}
          <div
            id="sidemenu"
            className={`sidemenu fixed top-0 left-0 h-screen w-3/4 bg-black transition-transform ${
              menuOpen ? "translate-x-0" : "-translate-x-full"
            }`}
          >
            <button id="fa-times" onClick={toggleMenu} className="m-4">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                height="24px"
                viewBox="0 -960 960 960"
                width="24px"
                fill="#e8eaed">
                <path d="m256-200-56-56 224-224-224-224 56-56 224 224 224-224 56 56-224 224 224 224-56 56-224-224-224 224Z" />
              </svg>
            </button>
            </div>  
            {/* Navbar */}
            <ul className="navbar flex flex-row  p-4">
              <li>
                <a href="#header" className="home">
                  Home
                </a>
              </li>
              <li>
                <a href="#about" className="home">
                  About
                </a>
              </li>
              <li>
                <a href="#services" className="home">
                  Services
                </a>
              </li>
              <li>
                <a href="#skill" className="home">
                  Skills
                </a>
              </li>
              <li>
                <a href="#portfolio" className="home">
                  Portfolio
                </a>
              </li>
              <li>
                <a href="#contact" className="home">
                  Contact
                </a>
              </li>
            </ul>
        </header>
        <div className="intro">
          <h1>Hi, It's Hamza</h1>
          <h3 className="heading-3">
            And I'm a <span className="heading-1"> Frontend Developer</span>
          </h3>
          <div className="buttons">
            <a href="/My Resume.pdf" className="btn">
              Download CV
            </a>
          </div>
          <div className="side-icon flex mt-4">
            <a href="https://www.facebook.com/m.hamza.rao1608"  >
              <i className="fab fa-facebook"></i>
            </a>
            <a
              href="https://www.instagram.com/m.hamza.rao1608/"
               >
              <i className="fab fa-instagram"></i>
            </a>
            <a
              href="https://www.linkedin.com/in/rao-hamza-920a04246/"
               >
              <i className="fab fa-linkedin"></i>
            </a>
            <a href="https://github.com/Hamxa52"  >
              <i className="fab fa-github"></i>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
